      );
      window.addEventListener("load", this.handleWindowLoad);

      // Performance APIを使って読み込みリソースを追跡
      if (window.PerformanceObserver) {
        this.observer = new PerformanceObserver(this.handlePerformanceEntries);
        this.observer.observe({ entryTypes: ["resource"] });
      }

      // 既存のリソースを取得
      this.collectExistingResources();

      // すでにreadyStateがcompleteの場合は完了とみなす
      if (document.readyState === "complete") {
        this.handleWindowLoad();
      }
    },

    collectExistingResources() {
      // 既に読み込まれているリソースを取得
      if (window.performance && window.performance.getEntriesByType) {
        const resources = window.performance.getEntriesByType("resource");
        resources.forEach((resource) => {
          if (!this.resourcesMap.has(resource.name)) {
            this.totalResources++;
            this.resourcesMap.set(resource.name, true);
            this.loadedResources++;
          }
        });
      }

      // 画像、スクリプト、スタイルシート、その他のリソースを追跡
      this.trackElements("img");
      this.trackElements("script");
      this.trackElements('link[rel="stylesheet"]');
      this.trackElements("video");
      this.trackElements("audio");
      this.trackElements("iframe");

      // 進捗状況の更新
      this.updateProgress();
    },

    trackElements(selector) {
      const elements = document.querySelectorAll(selector);
      elements.forEach((element) => {
        let src = "";

        if (element.tagName.toLowerCase() === "link") {
          src = element.href;
        } else if (element.src) {
          src = element.src;
        }

        if (src && !this.resourcesMap.has(src)) {
          this.totalResources++;
          this.resourcesMap.set(src, false);

          // すでに読み込まれているか確認
          if (element.complete || element.readyState === 4) {
            this.resourcesMap.set(src, true);
            this.loadedResources++;
          } else {
            // 読み込み完了時のイベントリスナーを追加
            element.addEventListener("load", () => {
              if (!this.resourcesMap.get(src)) {
                this.resourcesMap.set(src, true);
                this.loadedResources++;
                this.updateProgress();
              }
            });

            // エラー時のイベントリスナーも追加
            element.addEventListener("error", () => {
              if (!this.resourcesMap.get(src)) {
                this.resourcesMap.set(src, true);
                this.loadedResources++;
                this.updateProgress();
              }
            });
          }
        }
      });
    },

    handlePerformanceEntries(list) {
      list.getEntries().forEach((entry) => {
        if (!this.resourcesMap.has(entry.name)) {
          this.totalResources++;
          this.resourcesMap.set(entry.name, true);
          this.loadedResources++;
          this.updateProgress();
        }
      });
    },

    handleReadyStateChange() {
      // interactive状態になったらDOMの読み込みは完了
      if (document.readyState === "interactive") {
        this.updateProgress();
      }
      // complete状態になったら全リソースの読み込みが完了
      if (document.readyState === "complete") {
        this.handleWindowLoad();
      }
    },

    handleWindowLoad() {
      // 読み込みが完了した場合は100%に設定
      this.loadingProgress = 100;

      // 少し遅延して完了イベントを発火（トランジション効果のため）
      setTimeout(() => {
        this.$emit("loading-complete");
      }, 100);
    },

    updateProgress() {
      // リソースがない場合は、DOMの読み込み状態に基づいて進捗を設定
      if (this.totalResources === 0) {
        switch (document.readyState) {
          case "loading":
            this.loadingProgress = 30;
            break;
          case "interactive":
            this.loadingProgress = 70;
            break;
          case "complete":
            this.loadingProgress = 100;
            break;
        }
      } else {
        // リソースの読み込み進捗に基づいて進捗を計算
        this.loadingProgress = Math.min(
          Math.round((this.loadedResources / this.totalResources) * 100),
          100
        );
      }

      // 少なくとも10%から始める
      this.loadingProgress = Math.max(10, this.loadingProgress);
    },

    fvAnimation() {
      const maskLen = document
        .querySelector("#cursiveMask path")
        .getTotalLength();

      gsap.set("#cursiveMask path", {
        strokeDashoffset: maskLen,
      });

      // タイムラインを作成
      const tl = gsap.timeline();

      // パスのアニメーション
      tl.fromTo(
        "#cursiveMask path",
        {
          strokeDasharray: maskLen,
          strokeDashoffset: maskLen,
        },
        {
          strokeDashoffset: 0,
          duration: 2,
          ease: "power1.inOut",
        }
      );

      if (this.loadingProgress >= 99) {
        // アニメーション完了後、SVGテキストを上方向にフェードアウト
        gsap.to("#loading-screen", {
          y: -50, // 上方向に移動
          opacity: 0,
          duration: 1.2,
          delay: 2,
          ease: "power2.in",
        });
      }
    },
  },
};
</script>

